const nearConfig = getConfig(process.env.NODE_ENV || "development");
const { Meta } = Card;

function StreamIncome() {
  const element = [element0, element1, element2, element3];
  const stars = [
    [
      <StarFilled style={{ color: "#ff9e0d" }} />,
      <StarFilled />,
